*NICARAGUA É UMA DITADURA COMUNISTA HÁ MAIS DE 40 ANOS.*

*A MAIORIA DA POPULAÇÃO BRASILEIRA E NEM DOS EUA,JAPÃO,AUSTRALIA,NOVA ZELANDIA E DA EUROPA NUNCA SE IMPORTARAM NEM COM A CHINA COMUNISTA FAZ COM OS CHINESES ACEITANDO  SEM VER A AMEAÇA QUE SIGNIFICOU A INVASAO MASSIVA DAS QUINQUILHARIAS DA CHINA COMUNISTA PRODUZIDAS COM A MAO DE OBRA DE ESCRAVA COMPRANDO TODAS
AS PORCARIAS SEM QUALIDADE QUE ELES JOGAM NO BRASIL E ATÉ NESTES PAISES COMO OS EUA ATÉ AGORA NESTE 2022!*

OS POVOS DESTES PAÍSES NUNCA FIZERAM BOICOTE EM MASSA NÃO COMPRANDO NENHUMA DAS QUINQUILHARIAS SEM QUALIDADE E VENENOSAS FABRICADAS NA CHINA E EM OUTROS PAISES DO SUDESTE ASIATICO TODOS COMUNISTAS COMO O VIETNAN COMUNISTA.

O PRIMEIRO SINAL DE ALERTA E DE AMEACA DA TOMADA DE TODOS OS PAISES DO OCIDENTE FOI ATRAVES DA ABERTURA DESTE COMERCIO COM OS COMUNISTAS FEITO PELO BILL CLINTON O EX-PRESIDENTE DOS EUA NOS ANOS 90 ACEITANDO A CHINA COMO MEMBRO DA O.M.C (ORGANIZACAO MUNDIAL DO COMERCIO) NAO SO DA CHINA MAS PRINCIPALMENTE DA CHINA COM ESTE NEO COLONIALISMO DA CHINA PARA TRANFORMAR O OCIDENTE INTEIRO EM COLONIAS DOS COMUNISTAS!

*PAREM DE SEREM HIPOCRITAS E DENUNCIAR O QUE SEMPRE ACABA SENDO IMPOSTO COM O PASSAR DO TEMPO GRADUALMENTE EM TODAS AS DITADURAS TOTALITARIAS SEJAM ELAS SOCIALISTAS,TEOCRATICAS ISLAMICAS NAZI-FASCISTAS OU COMUNISTAS: A CRIMINALIZAÇÃO DO CRISTIANISMO E A PERSEGUIÇÃO E O EXTERMINIO SISTEMATICO DE CRISTÃOS COM FECHAMENTO DE TODAS AS IGREJAS CRISTÃS,DEPOIS A PERSEGUIÇÃO, DEPOIS A PRISÃO, DEPOIS A CAÇA, DEPOIS O ASSASSINATO DE CRISTÃOS.*

*Leandro Ruschel:*

Democracia é liberdade de expressão;

Ditador da Nicarágua fechou jornais e televisões;

Lula é aliado do ditadora da Nicarágua;

Jornal brasileiro denuncia apoio de Lula ao ditador;

Justiça brasileira CENSURA a matéria, a pedido de Lula;

Quem ameaça a democracia no Brasil?

